#include <iostream>
#include <string>

std::string Lsystem(std::string rule[], int nRules, std::string axiom, int gen)
{
	std::string set;
	set += axiom;
	
	for(int i = 0; i <= gen; i++)
	{
		std::cout << i << ". " << set << "\n";
		
		if(i == gen)
			break;
		
		std::string nextGen;
		for(int c = 0; c < set.size(); c++)
		{
			std::string app;
			app += set[c];
			
			for(int r = 0; r < nRules; r++)
				if(set[c] == rule[r][0])
				{
					app = rule[r].substr(3);
					break;
				}
			
			nextGen += app;
		}
		
		set = nextGen;
	}
	
	return set;
}

int main()
{
	std::string rule[] = {
		"X: X",
		"Y: [XY]X",
		"K: Y"
	};
	
	Lsystem(rule, sizeof(rule)/12, "Y", 5);
}

#include <iostream>
#include <cmath>
using namespace std;

 
int main()
{
    ios_base::sync_with_stdio(false);
    cin.tie(0);
    cout.tie(0);
    int a, b;
    cin >> a >> b;
    int res = 0;
    
    while(a != b) {
        if(a > b) {
            swap(a, b);
        }
        int najgolem_delitel = 1;
        int koren = sqrt(a);
        for(int i = 2; i <= koren; i++) {
            if(a % i == 0) {
                najgolem_delitel = a / i;
                break;
            }
        }
        int kolku_pati = (b - a + najgolem_delitel - 1) / najgolem_delitel;
        b -= kolku_pati * najgolem_delitel;
        res += kolku_pati;
    }
    cout << res << endl;

    return 0;
}

from abc import ABC, abstractmethod

# Abstract classes
class Card(ABC):
    @abstractmethod
    def get_info(self):
        pass

class Type(ABC):
    @abstractmethod
    def get_type(self):
        pass

class Style(ABC):
    @abstractmethod
    def get_style(self):
        pass

class Size(ABC):
    @abstractmethod
    def get_size(self):
        pass

class Cost(ABC):
    @abstractmethod
    def get_cost(self, area):
        pass

# Concrete classes
class BusinessCard(Card):
    def get_info(self):
        return "Business Card"

class InvitationCard(Card):
    def get_info(self):
        return "Invitation Card"

class MarriageCard(Card):
    def get_info(self):
        return "Marriage Card"

class Affordable(Type):
    def get_type(self):
        return "Affordable"

class Premium(Type):
    def get_type(self):
        return "Premium"

class Color(Style):
    def __init__(self, color):
        self.color = color

    def get_style(self):
        return f"Color: {self.color}"

class Design(Style):
    def __init__(self, design):
        self.design = design

    def get_style(self):
        return f"Design: {self.design}"

class SizeSpecification(Size):
    def __init__(self, height, width):
        self.height = height
        self.width = width

    def get_size(self):
        area = self.height * self.width
        return f"Size: {area} sq. cm"

class CardFactory(ABC):
    @abstractmethod
    def create_card(self):
        pass

# Concrete factories
class AffordableCardFactory(CardFactory):
    def create_card(self):
        return Affordable(), Color("Blue"), Design("Simple"), SizeSpecification(5, 8)

class PremiumCardFactory(CardFactory):
    def create_card(self):
        return Premium(), Color("Gold"), Design("Elegant"), SizeSpecification(6, 9)

class CardClient:
    def __init__(self, factory):
        self.type, self.style1, self.style2, self.size = factory.create_card()

    def show_card_info(self):
        print("Card Type:", self.type.get_type())
        print(self.style1.get_style())
        print(self.style2.get_style())
        print(self.size.get_size())
        area = self.size.height * self.size.width
        cost_factory = PremiumCostFactory() if isinstance(self.type, Premium) else AffordableCostFactory()
        cost_calculator = CostCalculator(cost_factory)
        cost = cost_calculator.calculate_cost(area)
        print("Cost: $", cost)

class CostFactory(ABC):
    @abstractmethod
    def create_cost(self):
        pass

class PremiumCostFactory(CostFactory):
    def create_cost(self):
        return PremiumCost()

class AffordableCostFactory(CostFactory):
    def create_cost(self):
        return AffordableCost()

class CostCalculator:
    def __init__(self, cost_factory):
        self.cost = cost_factory.create_cost()

    def calculate_cost(self, area):
        return self.cost.get_cost(area)

class PremiumCost(Cost):
    def get_cost(self, area):
        return area * 5  # $5 per sq. cm for Premium cards

class AffordableCost(Cost):
    def get_cost(self, area):
        return area * 1.5  # $1.5 per sq. cm for Affordable cards

# Client code
def main():
    factory1 = AffordableCardFactory()
    client1 = CardClient(factory1)
    print("=== Affordable Card Information ===")
    client1.show_card_info()
    print()

    factory2 = PremiumCardFactory()
    client2 = CardClient(factory2)
    print("=== Premium Card Information ===")
    client2.show_card_info()

if __name__ == "__main__":
    main()

